%% Gen_Parametric_Map_PCDE

clear all;

% Importing Multiple WB data
tic;
[Num_Passes,Num_Beds,Vol_WB,Vol_Multi_WB,Raw_Data_Multi_WB,Times_Multi_WB,Num_Times_Multi_WB]=Import_Dynamic_DCM_Multiple();
% Extracting LV data from WB
[LV_kBq,LV_PI_Time_Min]=Gen_WB_Input_IDIF(Num_Passes,Num_Beds,Vol_WB,Vol_Multi_WB,Raw_Data_Multi_WB,Times_Multi_WB,Num_Times_Multi_WB);
toc;

global Local_Estimates;
tic;
Decay_ind=1; % 1: Doing Decay Correction, 0: X Decay Correction
lamda=0.006; % 18F:6.3185*10^(-3), 177Lu=7.2416*10^(-5)
[Local_Estimates, Local_SSE, Plot_Measured, Plot_Fitted, Plot_IDIF]=Gen_IDIF(LV_kBq,LV_PI_Time_Min,1,0.006);
%[Local_Estimates, Local_SSE, Plot_Measured, Plot_Fitted, Plot_IDIF]=Gen_IDIF(LV_kBq,LV_PI_Time_Min,0,0.006); % No Decay Correction
toc;

%% Generation of 4D arrays for Kinetic Modeling

% Testing
%volumeViewer(Vol_WB.Pass_1{1,1});
%volumeViewer(Vol_WB.Pass_2{1,1});

% Making 4D Arrays of kBq [kBq/ml] & PI_Time [min]
tic;
%Make_4D_Array(Num_Passes,Num_Beds,Vol_WB,Vol_Multi_WB,Times_Multi_WB, Raw_Data_Multi_WB.Pass_1{1, 1}.RadiopharmaceuticalStartTime);
Make_4D_Array(Num_Passes,Num_Beds,Vol_WB,Vol_Multi_WB,Times_Multi_WB, Raw_Data_Multi_WB.Pass_1{1, 1}.RadiopharmaceuticalInformationSequence.Item_1.RadiopharmaceuticalStartTime, Decay_ind, lamda);
toc; % kBq_4D & PI_Time_4D for future usage!

% Generation of Parametric Map using PCDE
load PI_Times_Multi_WB.mat;
load Vol_Multi_WB_PCDE.mat;
t1=clock;
Denoising_Ind=1; % Denoising with FLT
PI_Times_PCDE=cell2mat(struct2cell(PI_Times_Multi_WB));
%chosen_params_WB=PCDE_WB(Num_Passes, Num_Beds,PI_Times_PCDE,Denoising_Ind); % Original Version
chosen_params_WB=PCDE_WB_ACC_Version(Vol_Multi_WB_PCDE, Num_Passes,Num_Beds, PI_Times_PCDE, Denoising_Ind); % Accelerated Version
%chosen_params_WB=PCDE_WB_half(Num_Passes, Num_Beds, PI_Times_PCDE, Vol_Multi_WB, kBq, PI_Time);
t2=clock;
Elapsed_Time=etime(t2,t1)/60/60 % [hr]
save("Total_Elapsed_Time", Elapsed_Time);

%% Codes when Using XCAT Phantom Images
%[Num_Passes, Num_Beds, PI_Times_PCDE, Vol_Multi_WB, WB_Vol]=Import_Dynamic_DCM_Multiple_XCAT();
Decay_ind=1;
lamda=0.006; % 18F:6.3185*10^(-3), 177Lu=7.2416*10^(-5)
[Num_Passes, Num_Beds, PI_Times_PCDE, Vol_Multi_WB, WB_Vol]= Import_Binary_XCAT(256,256,441,Decay_ind,lamda);
t1=clock;
% Making a 4D Array when using XCAT
Unit_ind=2; % Unit of XCAT Phantom Image ==> 1: [Bq/ml] 2: [kBq/ml] 
Make_4D_Array_XCAT(Num_Passes, Num_Beds, PI_Times_PCDE, Vol_Multi_WB, WB_Vol, Unit_ind); % saving 4D array of XCAT Phantom Image [kBq/ml] & PI_Time 4D

Denoising_Ind=0; % X Denoising!
chosen_params_WB=PCDE_WB(Num_Passes, Num_Beds, PI_Times_PCDE, Denoising_Ind);
t2=clock;
Elapsed_Time=etime(t2,t1)/60; % [min]

%% Saving Parametric Volume (for Both Cases, Either using Real Patient Data or XCAT Phantom Images)
chosen_params_WB=single(chosen_params_WB);
save("WB_PCDE.mat",'chosen_params_WB','-v7.3','-nocompression');
save("Elapsed_Time.mat",'Elapsed_Time','-v7.3','-nocompression');
save("t1.mat",'t1','-v7.3','-nocompression');
save("t2.mat",'t2','-v7.3','-nocompression');


%% Parametric Maps (from PCDE)
Slice_ind=136; % XCAT=> 136,DCF_2(irreversible)=> 115, DCF_2=> 58, HTK_1 => 58, AmBF3_1=>50, DCF_3=> 70, HTK_2=> 57, AmBF3_2=> 51
K1=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,1)), -90),2);
k2=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,2)), -90),2);
k3=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,3)), -90),2);
k4=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,4)), -90),2);
Ki= (K1.*k3) ./ (k2+k3);
Vd= (K1.*k2) ./ ((k2+k3).^(2));
BP= k3 ./ k4;
Vt= K1./k2 .*( 1+ k3./k4);
Ko= (k4.*k2) ./ (k2+k3);
Ki(isnan(Ki))=0; % removing NaN (e.g., 0/0=NaN)
Vd(isnan(Vd))=0; % removing NaN
BP(isnan(BP))=0; % removing NaN
Vt(isnan(Vt))=0; % removing NaN
Ko(isnan(Ko))=0; % removing NaN

%% Parametric Volume (from PCDE, Irreversible)
%K1=chosen_params_WB(:,:,:,1); k2=chosen_params_WB(:,:,:,2); k3=chosen_params_WB(:,:,:,3);
%Ki= (K1.*k3) ./ (k2+k3);
%Vd= (K1.*k2) ./ ((k2+k3).^(2));

%% Saving Parametric Volume into DCM files
%Vol_to_DCM(K1, Raw_Data_Multi_WB);
%Vol_to_DCM(k2, Raw_Data_Multi_WB);
%Vol_to_DCM(k3, Raw_Data_Multi_WB);
%Vol_to_DCM(Ki, Raw_Data_Multi_WB);
%Vol_to_DCM(Vd, Raw_Data_Multi_WB);


%% Parametric Maps (from 2TCM)
%Slice_ind=115; % DCF_2(irreversible)=> 115, DCF_2=> 58, HTK_1 => 58, AmBF3_1=>50, DCF_3=> 70, HTK_2=> 57, AmBF3_2=> 51
%K1=flip(imrotate(squeeze(k1(Slice_ind,:,:)), -90),2);
%k2=flip(imrotate(squeeze(k2(Slice_ind,:,:)), -90),2);
%k3=flip(imrotate(squeeze(k3(Slice_ind,:,:)), -90),2);
%k4=flip(imrotate(squeeze(k4(Slice_ind,:,:)), -90),2);
%Ki= (K1.*k3) ./ (k2+k3);
%Vd= (K1.*k2) ./ ((k2+k3).^(2));
%BP= k3 ./ k4;
%Vt= K1./k2 .*( 1+ k3./k4);
%Ko= (k4.*k2) ./ (k2+k3);


