%Slice_ind=115; % DCF_2(irreversible)=> 115, DCF_2=> 58, HTK_1 => 58, AmBF3_1=>50, DCF_3=> 70, HTK_2=> 57, AmBF3_2=> 51
%Ki=flip(imrotate(squeeze(K_i(Slice_ind,:,:)), -90),2);
