%VolumeViewer3D(chosen_params_WB(:,:,:,1)); % K1
%VolumeViewer3D(chosen_params_WB(:,:,:,2)); % k2
%VolumeViewer3D(chosen_params_WB(:,:,:,3)); % k3
%VolumeViewer3D(chosen_params_WB(:,:,:,4)); % k4


%% Gen_SUV Images using the estimated Kinetics (WB sharing a single time) (from PCDE)
Slice_ind=115; % DCF_2(irreversible)=> 115, DCF_2=> 58, HTK_1 => 58, AmBF3_1=>50, DCF_3=> 70, HTK_2=> 57, AmBF3_2=> 51
P_Weight=Raw_Data_Multi_WB.Pass_1{1, 1}.PatientWeight*1000; % [g]
t_half=(Raw_Data_Multi_WB.Pass_1{1, 1}.RadiopharmaceuticalInformationSequence.Item_1.RadionuclideHalfLife)/60; % [min]
Dose_initial=Raw_Data_Multi_WB.Pass_1{1, 1}.RadiopharmaceuticalInformationSequence.Item_1.RadionuclideTotalDose/1000; % [kBq]
t=[1:1:120]; % PI time [min]
Dose_t=Dose_initial.*exp(-1.*(log(2)./t_half).*t);
K1=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,1)), -90),2);
k2=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,2)), -90),2);
k3=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,3)), -90),2);
k4=flip(imrotate(squeeze(chosen_params_WB(Slice_ind,:,:,4)), -90),2);
K1_vec=K1(:); k2_vec=k2(:); k3_vec=k3(:); k4_vec=k4(:);
Ct_vec= TTCM_analytic_Multi([K1_vec,k2_vec,k3_vec,k4_vec], t);
Ct_vec(isnan(Ct_vec))=0; % removing Nan
for i=1:1:size(t,2)
    SUV_vec(:,i)= (Ct_vec(:,i)./Dose_t(1,i)).*P_Weight;
end
SUV_t=reshape(SUV_vec,size(K1,1),size(K1,2),size(t,2));
VolumeViewer3D(imrotate3(SUV_t,-90, [0 0 1]));

%% Gen_SUV Images using the estimated Kinetics (WB having each time for each bed) (from PCDE)
Slice_ind=115; % DCF_2(irreversible)=> 115, DCF_2=> 58, HTK_1 => 58, AmBF3_1=>50, DCF_3=> 70, HTK_2=> 57, AmBF3_2=> 51
P_Weight=Raw_Data_Multi_WB.Pass_1{1, 1}.PatientWeight*1000; % [g]
t_half=(Raw_Data_Multi_WB.Pass_1{1, 1}.RadiopharmaceuticalInformationSequence.Item_1.RadionuclideHalfLife)/60; % [min]
Dose_initial=Raw_Data_Multi_WB.Pass_1{1, 1}.RadiopharmaceuticalInformationSequence.Item_1.RadionuclideTotalDose/1000; % [kBq]
K1=squeeze(chosen_params_WB(Slice_ind,:,:,1));
k2=squeeze(chosen_params_WB(Slice_ind,:,:,2));
k3=squeeze(chosen_params_WB(Slice_ind,:,:,3));
k4=squeeze(chosen_params_WB(Slice_ind,:,:,4));
K1_vec=K1(:); k2_vec=k2(:); k3_vec=k3(:); k4_vec=k4(:);
for p=1:1:size(PI_Time,4)
    Dose_t=Dose_initial.*exp(-1.*(log(2)./t_half).*squeeze(PI_Time(Slice_ind,:,:,p)));
    PI_Time_vec=reshape(squeeze(PI_Time(Slice_ind,:,:,p)), size(Dose_t,1)*size(Dose_t,2),1 );
    for i=1:1:(size(Dose_t,1)*size(Dose_t,2))
        Ct_vec(i,1)=TTCM_analytic_Multi([K1_vec(i),k2_vec(i),k3_vec(i),k4_vec(i)],PI_Time_vec(i));
    end
    Ct=reshape(Ct_vec, size(Dose_t,1),size(Dose_t,2));
