%% Viewing XCAT Binary files
%[Num_Passes, Num_Beds, PI_Times_PCDE, Vol_Multi_WB, WB_Vol]= Import_Binary_XCAT(256,256,441);
%VolumeViewer3D(WB_Vol.Pass_1{1,1}); % [kBq/ml]
%VolumeViewer3D(WB_Vol.Pass_2{1,1}); % [Bq/ml]

%% Making DCM file
Vol_to_DCM(SUV_m(:,:,:,1), Raw_Data_Multi_WB);
Vol_to_DCM(SUV_PCDE(:,:,:,1), Raw_Data_Multi_WB);

%% Making Ct from Estimated Kinetics (from PCDE)
load WB_PCDE
load Raw_Data_Multi_WB.mat
load kBq
load PI_Time
K1=squeeze(chosen_params_WB(:,:,:,1));
k2=squeeze(chosen_params_WB(:,:,:,2));
k3=squeeze(chosen_params_WB(:,:,:,3));
k4=squeeze(chosen_params_WB(:,:,:,4));
K1_vec=K1(:); k2_vec=k2(:); k3_vec=k3(:); k4_vec=k4(:);
dims=size(K1);
Time=[0:1:90];
Ct=TTCM_analytic_Multi([K1_vec,k2_vec,k3_vec,k4_vec],Time);
for t=1:1:size(Time,2)
    Ct_PCDE(:,:,:,t)=reshape(Ct(:,t),[dims(1),dims(2),dims(3)]);
end
% Extract Mean value from DCM using DCM_RT file
[RT_S_file, RT_S_path, RT_S_index]=uigetfile('*.dcm'); % DCM RT Struct
RT_S_file_path= [RT_S_path,RT_S_file];
RT_S_Header=dicominfo(RT_S_file_path);
RT_S_Contour=dicomContours(RT_S_Header); % Extracting absolute coordinates of points which make contours
dims=size(Ct_PCDE);
image_size=[dims(1),dims(2),dims(3)]; % the # of voxels along with Rows X Columns X Z axis
Limit_X=[(Raw_Data_Multi_WB.Pass_1{1,1}.ImagePositionPatient(1,1)), (Raw_Data_Multi_WB.Pass_1{1,1}.PixelSpacing(2,1)*image_size(1,2))+(Raw_Data_Multi_WB.Pass_1{1, 1}.ImagePositionPatient(1,1))]; % for X-limit
Limit_Y=[(Raw_Data_Multi_WB.Pass_1{1,1}.ImagePositionPatient(2,1)), (Raw_Data_Multi_WB.Pass_1{1,1}.PixelSpacing(1,1)*image_size(1,1))+(Raw_Data_Multi_WB.Pass_1{1, 1}.ImagePositionPatient(2,1))]; % for Y-limit
for i=1:1:size(Raw_Data_Multi_WB.Pass_1,2)
    Limit_Z_temp(1,i)=Raw_Data_Multi_WB.Pass_1{4,i};
end
Limit_Z= [min(Limit_Z_temp), max(Limit_Z_temp)]; % for Z-limit
reference_Info=imref3d(image_size, Limit_X, Limit_Y, Limit_Z);
Struct_Mask=createMask(RT_S_Contour, 1, reference_Info);
Struct_Mask_array=double(Struct_Mask);
Num_of_Voxels_VOI=nnz(Struct_Mask_array);
for t=1:1:size(Time,2)
    Multiplied_matrix{t,1}=Ct_PCDE(:,:,:,t).*Struct_Mask_array; % for verifying the values in the VOI
    Image_Derived_Data_PCDE(t,1)= (sum(Multiplied_matrix{t,1}, 'all', 'double')) / (Num_of_Voxels_VOI); % Calc. of Mean Concentration of tracer in the VOI: unit = [Bq/ml]
end
Image_Derived_PITime_PCDE=transpose(Time);


%% Making Ct_Pass from Estimated Kinetics (from PCDE)
load WB_PCDE
load Raw_Data_Multi_WB.mat
load kBq
load PI_Time
K1=squeeze(chosen_params_WB(:,:,:,1));
k2=squeeze(chosen_params_WB(:,:,:,2));
k3=squeeze(chosen_params_WB(:,:,:,3));
k4=squeeze(chosen_params_WB(:,:,:,4));
K1_vec=K1(:); k2_vec=k2(:); k3_vec=k3(:); k4_vec=k4(:);
dims=size(chosen_params_WB);
Ct_PCDE_Pass=zeros(dims(1),dims(2),dims(3),dims(4),'single');
for p=1:1:dims(4)
    for k=1:1:dims(3)
        for j=1:1:dims(2)
            for i=1:1:dims(1)
                Ct_PCDE_Pass(i,j,k,p)=TTCM_analytic_Multi([K1(i,j,k,p),k2(i,j,k,p),k3(i,j,k,p),k4(i,j,k,p)],PI_Time(i,j,k,p));
            end
        end
    end
end



